/* global document, window */
import Calendar from './calendar';

const availabilityMap = '';
const mapStartDate    = new Date('2016-11-11');

window.calendarWidget2 = new Calendar({
  element: document.querySelector('.calendar2'),
  availabilityMap,
  availabilityUpdatedAt: mapStartDate,
  displayMonths: 3,
});

window.calendarWidget2.on('selection-start', (...args) => console.log(args));
window.calendarWidget2.on('selection-end', (...args) => console.log(args));
